    BatchNormalization_cnn_1d<Scalar, 32, 50>(
        layer_5_output.data(), layer_4_output.data(),
        gamma_5.data(), beta_5.data(),
        mean_5.data(), variance_5.data(),
        epsilon_5);

    // DEBUGGING, 1st 10 values of BatchNormalization layer 5:
    std::cout << "(BatchNormalization) layer 5:" << "\n";
    std::cout << "Shape -> ";
    std::cout << "(50, 32)" << "\n";
