    std::cout << " . . .\n\n";

    // Conv1D, layer 6
    static std::array<Scalar, 3200> layer_6_output;
    Conv1D_cnn_1d<Scalar, 64, 50>(
        layer_6_output.data(), layer_5_output.data(),
        convKernel_6.data(), convBias_6.data(),
        32, 50, 5, 1, 2,
        linear, 0.0);

    // DEBUGGING, 1st 10 values of Conv1D layer 6:
    std::cout << "(Conv1D) layer 6:" << "\n";
    std::cout << "Shape -> ";
    std::cout << "(50, 64)" << "\n";
