    std::cout << " . . .\n\n";

    // Pure Activation, layer 19
    static std::array<Scalar, 256> layer_19_output;
    for (int i = 0; i < 256; ++i) {
        mish(layer_19_output[i], layer_18_output[i], 0.0);
    }

    // DEBUGGING, 1st 10 values of Activation layer 19:
    std::cout << "(Activation) layer 19:" << "\n";
    std::cout << "Shape -> ";
    std::cout << "(256)" << "\n";
    std::cout << "Values -> ";
    for (int ii = 0; ii < 10; ++ii) {
        std::cout << layer_19_output[ii];
        if (ii < 10 - 1) std::cout << ", ";
    }
    std::cout << " . . .\n\n";

    // Dense, layer 21
    static std::array<Scalar, 128> layer_21_output;
    Dense_cnn_1d<Scalar, 128>(
        layer_21_output.data(), layer_19_output.data(),
        weights_21.data(), biases_21.data(),
        256, gelu, 0.0);

    // DEBUGGING, 1st 10 values of Dense layer 21:
    std::cout << "(Dense) layer 21:" << "\n";
    std::cout << "Shape -> ";
    std::cout << "(128)" << "\n";
    std::cout << "Values -> ";
